import React from 'react'

const LogOutPage = () => {

    return (
        <button 
            type="button" 
            className="btn btn-primary btn-block"
            onClick={
                localStorage.clear(),
                history.push('/')
            }
        >Log Out
        </button>

    )
}

export default LogOutPage
